enum SamplerType : unsigned int {
    HALTON = 0,
    SOBOL = 1,
};

struct Sampler {
    SamplerType type;
    uint index;
    uint dimension;
    uint frameIndex;
    
    Sampler(SamplerType _type, uint _index, uint _frameIndex) {
        type = _type;
        index = _index;
        dimension = 0;
        frameIndex = _frameIndex;
    }
    
    float r();
    float2 r2();
    float3 r3();
};

